import { TextField } from '@material-ui/core'
import React, { useEffect, useState } from 'react'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import { getManagers } from '../../main_redux/actions/managers'
import { getData } from '../../main_redux/actions/server_connections'
import { getWorkers } from '../../main_redux/actions/workers'
import './style.css'

function Enter (props)  {

    useEffect(() => {
        props.set('managers', getManagers)
      }, []);

    const [login, setLogin] = useState('')
    const [password, setPassword] = useState('')

    let currrentManager = props.managers.find(el => el.code === login && el.password === password)

    return(
        <div className='enter__position'>
            <div>
            Enter
            </div>
            <TextField label='code' onChange={(e) => setLogin(e.target.value)} value={login}/>
            <TextField type='password' label='password' onChange={(e) => setPassword(e.target.value)} value={password}/>

            <Link to={currrentManager === undefined ? '/' : '/brands_list'}>Вход</Link>
        </div>
    )
}
export default connect(
    state => ({
        managers: state.managers.managers
    }),
    dispatch => ({
        set: (path, setter) => dispatch(getData(path, setter))
    })
)(Enter)
